import React from 'react';
import '../Styles/alternativeHeader.css';

const ContactHeader = () => {
    return (
        <div className="alternative-header">
            <div className="alternative-header-content">
                <h1><strong>Contact Us</strong></h1>

            </div>
        </div>
    );
};

export default ContactHeader;
